import React from "react";
import { Container, Typography } from "@mui/material";

const Home = () => {
  return (
    <Container>
      <Typography variant="h4" component="h1" gutterBottom>
        Welcome to Friend Connect
      </Typography>
    </Container>
  );
};

export default Home;
